{'Comment': 'I bought this since it was much cheaper than the Sandisk UHS-II v90 cards, as v60 should be sufficient for my needs.

Im using this with the Fuji X-T3 and have write errors if I try to record video at 400Mbps.

400Mb/s / 8 = 50MB/s, v60 = 60MB/s min, so this card is not supposed to have a problem.', 'Source': 'B&H Photo', 'CommentDate': '2019-05-15', 'rating': 2.0, 'max_rating': 5.0, 'average_rating': 4.5}
